public class Task4 {
    public static void main(String[] args) {

        char tab[] = {'A', 'l', 'a', ' ', 'm', 'a', ' ', 'k', 'o', 't', 'a'};
        policz(tab);
    }

    public static void policz(char tab[]) {

        for (char znak = 0; znak < 256; znak++) {

            int liczbaWystapien = 0;

            for (int i = 0; i < tab.length; i++) {
                if( tab[i] == znak )
                    liczbaWystapien++;
            }

            if(liczbaWystapien > 0)
                System.out.println("Znak: " + znak + " wystapil: " + liczbaWystapien);

        }
    }
}
